import ProjectCard from '../components/ProjectCard'

const projects = [
  {
    title: 'E-commerce Website',
    description: 'A full-featured online store with product listings, cart functionality, and checkout process.',
    imageUrl: 'https://via.placeholder.com/400x225?text=E-commerce+Website'
  },
  {
    title: 'Task Management App',
    description: 'A productivity application for organizing tasks with drag-and-drop functionality and team collaboration.',
    imageUrl: 'https://via.placeholder.com/400x225?text=Task+App'
  },
  {
    title: 'Weather Dashboard',
    description: 'Real-time weather information with 5-day forecast and location-based services.',
    imageUrl: 'https://via.placeholder.com/400x225?text=Weather+Dashboard'
  }
]

export default function Projects() {
  return (
    <div className="min-h-screen flex flex-col">
      <main className="flex-grow container mx-auto px-4 py-8">
        <h1 className="text-3xl font-bold mb-8 text-center">My Projects</h1>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {projects.map((project, index) => (
            <ProjectCard 
              key={index}
              title={project.title}
              description={project.description}
              imageUrl={project.imageUrl}
            />
          ))}
        </div>
      </main>
    </div>
  )
}
